  return <h2>I like {fav} movies!</h2>;
}

const movieILike = [
  { name: horor },
  { name: romance },
  { name: fantasy },
  { name: comic }
];

function App() {
  return (
    <div className="App">
      <h1>eeeyeah!</h1>
      <Movie fav="horor"/>
      { movieILike.map(genre => {
        return genre;
      }) }
    </div>
  );
}

export default App;
